});

import { v4 } from "uuid";
import type { NewPlant, Plant } from "../../interface/plant.js";
import { jsonFile } from "./store-util.js";
import type { PlantStore } from "../../db.js";
import type { User } from "../../interface/user.js";

export const plantJsonStore: PlantStore = {
  async getAll(): Promise<Plant[]> {
    await jsonFile.read();

    return jsonFile.data.plants.map((p: Plant) => ({
      ...p,
      date: new Date(p.date),
    }));
  },

  async getById(plantId: Plant["_id"]): Promise<Plant | null> {
    await jsonFile.read();

    const foundPlant = jsonFile.data.plants.find((p: Plant) => p._id === plantId);
    if (!foundPlant) return null;

    return {
      ...foundPlant,
      date: new Date(foundPlant.date),
    };
  },
  async getAllForUser(userId: User["_id"]): Promise<Plant[]> {
    await jsonFile.read();
    const foundPlants = jsonFile.data.plants.filter((p: Plant) => p.userId === userId);
    return foundPlants.map((p: Plant) => ({
      ...p,
      date: new Date(p.date),
    }));
  },

  async createForUser(userId: User["_id"], newPlant: NewPlant): Promise<Plant> {
    await jsonFile.read();
    const plant: Plant = { ...newPlant, _id: v4(), userId: userId, date: new Date() } as Plant;
    jsonFile.data.plants.push(plant);
    await jsonFile.write();
    return plant;
  },

  async update(plant: Plant): Promise<Plant | null> {
    await jsonFile.read();
    const index = jsonFile.data.plants.findIndex((p: Plant) => p._id === plant._id);
    if (index === -1) {
      return null;
    }
    jsonFile.data.plants[index] = plant;
    await jsonFile.write();
    return plant;
  },

  async deleteAll(): Promise<Plant[]> {
    await jsonFile.read();
    const foundPlants = jsonFile.data.plants;
    jsonFile.data.plants = [];
    await jsonFile.write();
    return foundPlants;
  },

  async deleteById(plantId: Plant["_id"]): Promise<Plant | null> {
    await jsonFile.read();
    const index = jsonFile.data.plants.findIndex((p: Plant) => p._id === plantId);
    if (index === -1) return null;
    const plant: Plant = jsonFile.data.plants[index];
    jsonFile.data.plants.splice(index, 1);
    await jsonFile.write();
    return plant;
  },
};

import { v4 } from "uuid";
import type { CollectionStore } from "../../db.js";
import { jsonFile } from "./store-util.js";
import type { Collection, NewCollection } from "../../interface/collection.js";
import type { User } from "../../interface/user.js";
import type { Plant } from "../../interface/plant.js";

export const collectionJsonStore: CollectionStore = {
  async getAll(): Promise<Collection[]> {
    await jsonFile.read();
    return jsonFile.data.collections;
  },

  async getById(collectionId: Collection["_id"]): Promise<Collection | null> {
    await jsonFile.read();
    const foundCollection = jsonFile.data.collections.find((c: Collection) => c._id === collectionId);
    return foundCollection ?? null;
  },

  async getAllForUser(userId: User["_id"]): Promise<Collection[]> {
    await jsonFile.read();
    return jsonFile.data.collections.filter((c: Collection) => c.userId === userId);
  },

  async createForUser(userId: User["_id"], newCollection: NewCollection): Promise<Collection> {
    await jsonFile.read();
    const collection: Collection = { ...newCollection, _id: v4(), userId: userId, plantIds: [] } as Collection;
    jsonFile.data.collections.push(collection);
    await jsonFile.write();
    return collection;
  },

  async update(collection: Collection): Promise<Collection | null> {
    await jsonFile.read();
    const index = jsonFile.data.collections.findIndex((c: Collection) => c._id === collection._id);
    if (index === -1) {
      return null;
    }
    jsonFile.data.collections[index] = collection;
    await jsonFile.write();
    return collection;
  },

  async deleteAll(): Promise<Collection[]> {
    await jsonFile.read();
    const foundCollections = jsonFile.data.collections;
    jsonFile.data.collections = [];
    await jsonFile.write();
    return foundCollections;
  },

  async deleteById(collectionId: Collection["_id"]): Promise<Collection | null> {
    await jsonFile.read();
    const index = jsonFile.data.collections.findIndex((c: Collection) => c._id === collectionId);
    if (index === -1) return null;
    const collecation: Collection = jsonFile.data.collections[index];
    jsonFile.data.collections.splice(index, 1);
    await jsonFile.write();
    return collecation;
  },

  async addPlantToCollection(collectionId: Collection["_id"], plantId: Plant["_id"]): Promise<Collection | null> {
    await jsonFile.read();
    const index = jsonFile.data.collections.findIndex((c: Collection) => c._id === collectionId);
    if (index === -1) return null;
    jsonFile.data.collections[index].plantIds.push(plantId);
    await jsonFile.write();
    return jsonFile.data.collections[index];
  },
};
